
<!DOCTYPE html>
<html lang="no">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
<title>❤️ Til deg ❤️</title>

<meta name="theme-color" content="#330033">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">

<style>
body {
    margin: 0;
    background: linear-gradient(to bottom, #1a001a, #330033);
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", sans-serif;
    color: white;
    text-align: center;
    overflow: hidden;
}

.container {
    padding: 30px;
    position: relative;
    z-index: 2;
}

h1 {
    font-size: 26px;
    margin-bottom: 30px;
}

button {
    padding: 18px 40px;
    font-size: 20px;
    border: none;
    border-radius: 50px;
    background: #ff4d6d;
    color: white;
    cursor: pointer;
    transition: 0.3s;
    box-shadow: 0 0 20px rgba(255, 0, 100, 0.7);
}

button:active {
    transform: scale(0.95);
}

.rose-img {
    width: 240px;
    margin: 30px auto;
    display: none;
    opacity: 0;
    animation: fadeIn 2s forwards, float 4s ease-in-out infinite;
    border-radius: 25px;
    box-shadow: 0 0 50px rgba(255, 0, 120, 0.8);
    position: relative;
    z-index: 1;
}

.message {
    font-size: 30px;
    margin-top: 25px;
    display: none;
    opacity: 0;
    animation: fadeIn 3s forwards;
}

.heart {
    position: fixed;
    top: -20px;
    animation: fall linear forwards;
    z-index: 9999;
    pointer-events: none;
}

@keyframes fadeIn {
    from { opacity: 0; }
    to { opacity: 1; }
}

@keyframes float {
    0% { transform: translateY(0px); }
    50% { transform: translateY(-12px); }
    100% { transform: translateY(0px); }
}

@keyframes fall {
    to {
        transform: translateY(110vh);
        opacity: 0;
    }
}
</style>
</head>

    </div>
</div>

<script>
let continuousInterval;

function showLove() {
    const rose = document.getElementById("rose");
    const message = document.getElementById("message");
    const button = document.getElementById("loveButton");
    const topText = document.getElementById("topText");

    button.style.display = "none";
    rose.style.display = "block";
    message.style.display = "block";
    topText.innerText = "Happy Valentines elskling❤️";

    burstHearts();
    startContinuousHearts();
}

function createHeart() {
    const heart = document.createElement("div");
    heart.className = "heart";
    heart.innerHTML = "❤️";
    heart.style.left = Math.random() * 100 + "vw";
    heart.style.fontSize = (Math.random() * 25 + 15) + "px";
    heart.style.animationDuration = (Math.random() * 3 + 3) + "s";
    document.body.appendChild(heart);

    setTimeout(() => {
        heart.remove();
    }, 6000);
}

function burstHearts() {
    for (let i = 0; i < 300; i++) {
        createHeart();
    }
}

function startContinuousHearts() {
    // 12 hearts per second ≈ every 83ms
    continuousInterval = setInterval(() => {
        createHeart();
    }, 83);
}
</script>
